    /**
     * Custom DML update/insert/delete logic here.
     * @param operation the operation type
     * @param e the transaction event
     */
    protected void doDML(int operation, TransactionEvent e) {
        if (operation==DML_INSERT) {
            ApplicationModule am=this.getDBTransaction().getRootApplicationModule();
            ViewObject        vo=am.findViewObject("myJobSolPK");
            if (vo!=null)
                {
                   vo.remove();     
                }
            vo=am.createViewObjectFromQueryStmt("myJobSolPK",
            "   Select '2"+getLocationid()+DigicomClass.doGetFormattedDate(getJsDate().toString(), "yyMM")+"'||Lpad(nvl(max(to_number(substr(JSolution_Id,-5)))+1,1) ,5,'0')\n" + 
            "   from SRV_JOBSOLUTION\n" + 
            "   Where to_char(JS_DATE,'rrmm') = '"+DigicomClass.doGetFormattedDate(getJsDate().toString(), "yyMM")+"'\n" + 
            "   and locationid = '"+getLocationid()+"'");
            vo.executeQuery();
            setJsolutionId(vo.first().getAttribute(0).toString());
        } 
        super.doDML(operation, e);
    }
